import { useState, useEffect } from "react";
import BlogList from "./BlogList";
import useFetch from "./useFetch";

const Home = () => {
  const {
    data: exams,
    isPending,
    error,
  } = useFetch("http://localhost:8000/exams");

  return (
    <div className="home">
      {error && <div>{error}</div>}
      {isPending && <div>Loading...</div>}
      {exams &&
        exams
          .filter((exam) => exam.examName.includes("k"))
          .map((fil) => <div>fil</div>)}
      {exams && <BlogList exams={exams} title="Active Exams" />}
    </div>
  );
};

export default Home;
